import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;

  return {
    container: {
      width: "60%",
      height: "60%"
    },
    number: {
      color: colors.secondary
    },
    pageTitle: {
      color: colors.white,
      marginLeft: 10
    },
    socialLinkContainer: {
      position: "absolute",
      bottom: 0,
      left: 40
    },
    text: {
      padding: 15,
      "&:hover": {
        background: "rgba(99, 255, 218, 0.4)"
      }
    }
  };
});
